// This function parses information from the data about the maximum value 
// of the kurtogram. From the location (where this maximum was found) 
// compute the frequency and frequency resolution.

var msg1 = {};
var msg2 = {};
var msg3 = {};

//frequency resolution
msg1.payload = Math.pow(2, -msg.payload[0]-1)*11560;

//frequency
var index = msg.payload[1]/(16/Math.pow(2, msg.payload[0]));
msg2.payload = (index+0.5)*msg1.payload;

// maximum of kurtogramu
var bits = (msg.payload[5] << 24) | (msg.payload[4] << 16) | (msg.payload[3] << 8) | (msg.payload[2]);
var sign = ((bits >>> 31) === 0) ? 1.0 : -1.0;
var e = ((bits >>> 23) & 0xff);
var m = (e === 0) ? (bits & 0x7fffff) << 1 : (bits & 0x7fffff) | 0x800000;
var f = sign * m * Math.pow(2, e - 150);

msg3.payload = f.toFixed(2);


 return [msg1, msg2, msg3];

// This function provides information about the modulation, frequency, 
// and number of gateways used in the path.

var msg1 = {};
var msg2 = {};
var msg3 = {};

msg1.payload = msg.metadata.frequency;
msg2.payload = msg.metadata.modulation;
msg3.payload = msg.metadata.gateways.length;

return [msg1, msg2, msg3];

// Compute mean of RSSI during runtime

msg.payload = 0;

var count = global.get('count') || 0;
var value = global.get('value') || 0;

var i;
for (i = 0; i < msg.metadata.gateways.length; i++) { 
    value += msg.metadata.gateways[i].rssi;
}

count += msg.metadata.gateways.length;
msg.payload = (value/count).toFixed(0);

global.set('count',count);
global.set('value',value);

return msg;

// Compute mean of SNR during runtime

msg.payload = 0;

var count_snr = global.get('count_snr') || 0;
var value_snr = global.get('value_snr') || 0;

var i;
for (i = 0; i < msg.metadata.gateways.length; i++) { 
    value_snr += msg.metadata.gateways[i].snr;
}

count_snr += msg.metadata.gateways.length;
msg.payload = (value_snr/count_snr).toFixed(2);

global.set('count_snr',count_snr);
global.set('value_snr',value_snr);

return msg;

// Information about RSSI, from metadata, for each of the gateways.

var msg1 = {};
var msg2 = {};

// only one gateway
if(msg.metadata.gateways.length !=2)
{
    msg1.payload = msg.metadata.gateways[0].rssi;
    msg1.topic = 'second gateway in path';

    msg2.payload = msg.metadata.gateways[0].rssi;
    msg2.topic = 'first gateway in path';
}
// more gateways
else
{
    if(msg.metadata.gateways[0].time < msg.metadata.gateways[1].time)
    {
        msg1.payload = msg.metadata.gateways[1].rssi;
        msg1.topic = 'second gateway in path';

        msg2.payload = msg.metadata.gateways[0].rssi;
        msg2.topic = 'first gateway in path';
    }
    else
    {
        msg1.payload = msg.metadata.gateways[0].rssi;
        msg1.topic = 'second gateway in path';

        msg2.payload = msg.metadata.gateways[1].rssi;
        msg2.topic = 'first gateway in path';
    }

}
return [msg1, msg2];

// Information about SNR, from metadata, for each of the gateways.

var msg1 = {};
var msg2 = {};

if(msg.metadata.gateways.length !=2)
{
    msg1.payload = msg.metadata.gateways[0].snr;
    msg1.topic = 'second gateway in path';

    msg2.payload = msg.metadata.gateways[0].snr;
    msg2.topic = 'first gateway in path';
}
else
{
    if(msg.metadata.gateways[0].time < msg.metadata.gateways[1].time)
    {
        msg1.payload = msg.metadata.gateways[1].snr;
        msg1.topic = 'second gateway in path';

        msg2.payload = msg.metadata.gateways[0].snr;
        msg2.topic = 'first gateway in path';
    }
    else
    {
        msg1.payload = msg.metadata.gateways[0].snr;
        msg1.topic = 'second gateway in path';

        msg2.payload = msg.metadata.gateways[1].snr;
        msg2.topic = 'first gateway in path';
    }

}
return [msg1, msg2];

//Determination of maximal kurtosis ratio

var msg1 = {};

var maximumKR = global.get('maximumKR') || -100;

if (msg.payload > maximumKR)
{
    global.set('maximumKR',msg.payload);
    msg1.payload = msg.payload.toFixed(2);
}
else
{
    msg1.payload = maximumKR.toFixed(2);
}

return msg1;

// Saving information from the data about RMS, crest factor and kurtosis ratio
// and their conversion to the decimal number.

var msg1 = {};
var msg2 = {};
var msg3 = {};

// RMS
var bits = (msg.payload[9] << 24) | (msg.payload[8] << 16) | (msg.payload[7] << 8) | (msg.payload[6]);
var sign = ((bits >>> 31) === 0) ? 1.0 : -1.0;
var e = ((bits >>> 23) & 0xff);
var m = (e === 0) ? (bits & 0x7fffff) << 1 : (bits & 0x7fffff) | 0x800000;
var f = sign * m * Math.pow(2, e - 150);
msg1.payload = f;

// crest factor
bits = (msg.payload[13] << 24) | (msg.payload[12] << 16) | (msg.payload[11] << 8) | (msg.payload[10]);
sign = ((bits >>> 31) === 0) ? 1.0 : -1.0;
e = ((bits >>> 23) & 0xff);
m = (e === 0) ? (bits & 0x7fffff) << 1 : (bits & 0x7fffff) | 0x800000;
f = sign * m * Math.pow(2, e - 150);
msg2.payload = f;

// kurtosis ratio
bits = (msg.payload[17] << 24) | (msg.payload[16] << 16) | (msg.payload[15] << 8) | (msg.payload[14]);
sign = ((bits >>> 31) === 0) ? 1.0 : -1.0;
e = ((bits >>> 23) & 0xff);
m = (e === 0) ? (bits & 0x7fffff) << 1 : (bits & 0x7fffff) | 0x800000;
f = sign * m * Math.pow(2, e - 150);
msg3.payload = f;

return [msg1, msg2, msg3];

//Determination of maximal RMS

var msg1 = {};

var maximumRMS = global.get('maximumRMS') || 0;

if (msg.payload > maximumRMS)
{
    global.set('maximumRMS',msg.payload);
    msg1.payload = msg.payload.toFixed(2);
}
else
{
    msg1.payload = maximumRMS.toFixed(2);
}

return msg1;

//Determination of maximal crest factor

var msg1 = {};

var maximumCrest = global.get('maximumCrest') || 0;

if (msg.payload > maximumCrest)
{
    global.set('maximumCrest',msg.payload);
    msg1.payload = msg.payload.toFixed(2);
}
else
{
    msg1.payload = maximumCrest.toFixed(2);
}

return msg1;

// Function email creates the structure of email messages.
if(msg.payload == 1)
{
    msg.payload = "Podezření na poruchu monitorovaného přístroje.\n\r " ;
    msg.topic = "Condition monitoring system";
    return msg
}

//Specify the string written to the user interface according to the fault identification.

if(msg.payload == 1)
{
    msg.payload = "NOT OK" ;
}
else
{
    msg.payload = "OK" ;
}
return msg;

// This function keeps the last three crest factor values and the last three 
// kurtogram level values where the maximum was found.
// From these data, it determines possibility of failure (set an indicator).

var msg1 = {};

// read global variable
var firstvalueCF = global.get('firstvalueCF') || -1;
var secondvalueCF = global.get('secondvalueCF') || -1;

var firstvalue = global.get('firstvalue') || -1;
var secondvalue = global.get('secondvalue') || -1;

var index = global.get('index') || 0;


// read actual value of crest factor
var bits = (msg.payload[13] << 24) | (msg.payload[12] << 16) | (msg.payload[11] << 8) | (msg.payload[10]);
var sign = ((bits >>> 31) === 0) ? 1.0 : -1.0;
var e = ((bits >>> 23) & 0xff);
var m = (e === 0) ? (bits & 0x7fffff) << 1 : (bits & 0x7fffff) | 0x800000;
var f = sign * m * Math.pow(2, e - 150);

// set fault indicator
if (msg.payload[0] > 1 &&  firstvalue > 1 &&  secondvalue > 1 && f > 3.5 && firstvalueCF > 3.5 && secondvalueCF > 3.5)
{
    msg1.payload = 1;

}
else
{
    msg1.payload = 0;
}

// save global variable
if(index === 0)
{
    global.set('firstvalue', msg.payload[0]);
    global.set('firstvalueCF', f);
    global.set('index',1);
}
else
{
    global.set('secondvalue', msg.payload[0]);
    global.set('secondvalueCF', f);
    global.set('index',0);
}

return msg1;
